import React from 'react';
import "./ModalBody.css";


const ModalBody = () => {
    return ( 
        <div className="row">
            <div className="col">
                <div className="row inbox">
                    <i className="fa fa-inbox"></i>
                    <p>Inbox</p>
                </div>
                <div className="row inbox2">
                    <i className="fa fa-star"></i>
                    <p>Started</p>
                </div>
            </div>
        </div>
     );
}

export default ModalBody;
